import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route exact path="/" component={NameList} />
        <Route exact path="/users/:id" component={InfoCard} />
      </BrowserRouter>
    </div>
  );
}

export default App;
